DROP TABLE IF EXISTS `cant_amarillas_ligaequip`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `cant_amarillas_ligaequip` AS select `c`.`comp_nombre` AS `Liga`,sum(`j`.`jug_amarillas`) AS `TotalAmarillas`,(select concat(`e2`.`equip_nombre`,' (',sum(`j2`.`jug_amarillas`),')') from (`jugadores` `j2` join `equipos` `e2` on(`j2`.`jug_equipo` = `e2`.`equip_cod`)) where `j2`.`jug_competicion` = `c`.`comp_cod` group by `e2`.`equip_nombre` order by sum(`j2`.`jug_amarillas`) desc limit 1) AS `EquipoConMasAmarillas` from (`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) group by `c`.`comp_nombre`,`c`.`comp_cod`;

DROP TABLE IF EXISTS `equip_conmax_rojas`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `equip_conmax_rojas` AS select `c`.`comp_nombre` AS `Liga`,sum(`j`.`jug_rojas`) AS `TotalRojas`,(select concat(`e2`.`equip_nombre`,' (',sum(`j2`.`jug_rojas`),')') from (`jugadores` `j2` join `equipos` `e2` on(`j2`.`jug_equipo` = `e2`.`equip_cod`)) where `j2`.`jug_competicion` = `c`.`comp_cod` group by `e2`.`equip_nombre` order by sum(`j2`.`jug_rojas`) desc limit 1) AS `EquipoConMasRojas` from (`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) group by `c`.`comp_nombre`,`c`.`comp_cod`;

DROP TABLE IF EXISTS `jugnodl_mas_gls`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `jugnodl_mas_gls` AS select `j`.`jug_nombre` AS `Nombre`,`j`.`jug_gls` AS `Goles`,`c`.`comp_nombre` AS `Liga`,`e`.`equip_nombre` AS `Equipo`,`j`.`jug_edad` AS `Edad`,`p`.`pos_descrip` AS `Posicion`,`n`.`nac_nombre` AS `Nacionalidad` from ((((`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `posicion` `p` on(`j`.`jug_posicion` = `p`.`pos_cod`)) join `nacionalidad` `n` on(`j`.`jug_nacionalidad` = `n`.`nac_cod`)) join `equipos` `e` on(`j`.`jug_equipo` = `e`.`equip_cod`)) where `p`.`pos_descrip` <> 'FW' order by `j`.`jug_gls` desc limit 1,10;

DROP TABLE IF EXISTS `max_ast_ligue1`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `max_ast_ligue1` AS select `j`.`jug_nombre` AS `Nombre`,`j`.`jug_ast` AS `Asistencias`,`c`.`comp_nombre` AS `Liga`,`j`.`jug_edad` AS `Edad`,`p`.`pos_descrip` AS `posicion`,`n`.`nac_nombre` AS `Nacionalidad` from (((`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `posicion` `p` on(`j`.`jug_posicion` = `p`.`pos_cod`)) join `nacionalidad` `n` on(`j`.`jug_nacionalidad` = `n`.`nac_cod`)) where `c`.`comp_nombre` = 'Ligue 1' order by `j`.`jug_ast` desc limit 1;

