CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `max_gol_premier` AS select `j`.`jug_nombre` AS `Nombre`,`j`.`jug_gls` AS `Goles`,`c`.`comp_nombre` AS `competicion`,`j`.`jug_edad` AS `Edad`,`n`.`nac_nombre` AS `Nacionalidad`,`p`.`pos_descrip` AS `posicion` from (((`jugadores` `j` join `nacionalidad` `n` on(`j`.`jug_nacionalidad` = `n`.`nac_cod`)) join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `posicion` `p` on(`j`.`jug_posicion` = `p`.`pos_cod`)) where `c`.`comp_nombre` = 'Premier League' order by `j`.`jug_gls` desc limit 1;

DROP TABLE IF EXISTS `posicion_jugadores`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `posicion_jugadores` AS select `j`.`jug_cod` AS `jug_cod`,`j`.`jug_nombre` AS `jug_nombre`,group_concat(distinct `p`.`pos_descrip` order by `p`.`pos_descrip` ASC separator ', ') AS `posiciones` from ((`jugadores` `j` join `jugador_posicion` `jp` on(`j`.`jug_cod` = `jp`.`jp_jug_cod`)) join `posicion` `p` on(`jp`.`jp_pos_cod` = `p`.`pos_cod`)) group by `j`.`jug_cod`,`j`.`jug_nombre` order by `j`.`jug_cod`;

DROP TABLE IF EXISTS `rojastotal_bun_pre`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `rojastotal_bun_pre` AS (select `Bundesliga`.`Codigo` AS `Codigo`,`Bundesliga`.`Nombre` AS `Nombre`,`Bundesliga`.`Liga` AS `Liga`,`Bundesliga`.`Equipo` AS `Equipo`,`Bundesliga`.`RojasTotal` AS `RojasTotal` from (select `j`.`jug_cod` AS `Codigo`,`j`.`jug_nombre` AS `Nombre`,`c`.`comp_nombre` AS `Liga`,`e`.`equip_nombre` AS `Equipo`,count(`j`.`jug_rojas`) AS `RojasTotal` from ((`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `equipos` `e` on(`j`.`jug_equipo` = `e`.`equip_cod`)) where `c`.`comp_nombre` = 'Bundesliga' group by `j`.`jug_cod`,`j`.`jug_nombre` order by count(`j`.`jug_rojas`) desc limit 10) `Bundesliga`) union all (select `PremierLeague`.`Codigo` AS `Codigo`,`PremierLeague`.`Nombre` AS `Nombre`,`PremierLeague`.`Liga` AS `Liga`,`PremierLeague`.`Equipo` AS `Equipo`,`PremierLeague`.`RojasTotal` AS `RojasTotal` from (select `j`.`jug_cod` AS `Codigo`,`j`.`jug_nombre` AS `Nombre`,`c`.`comp_nombre` AS `Liga`,`e`.`equip_nombre` AS `Equipo`,count(`j`.`jug_rojas`) AS `RojasTotal` from ((`jugadores` `j` join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `equipos` `e` on(`j`.`jug_equipo` = `e`.`equip_cod`)) where `c`.`comp_nombre` = 'Premier League' group by `j`.`jug_cod`,`j`.`jug_nombre` order by count(`j`.`jug_rojas`) desc limit 10) `PremierLeague`);

DROP TABLE IF EXISTS `top10_goles_argentinos`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `top10_goles_argentinos` AS select `j`.`jug_cod` AS `jug_cod`,`j`.`jug_nombre` AS `Nombre`,`j`.`jug_gls` AS `Goles`,`e`.`equip_nombre` AS `Equipo`,`c`.`comp_nombre` AS `Competicion` from (((`jugadores` `j` join `nacionalidad` `n` on(`j`.`jug_nacionalidad` = `n`.`nac_cod`)) join `competicion` `c` on(`j`.`jug_competicion` = `c`.`comp_cod`)) join `equipos` `e` on(`j`.`jug_equipo` = `e`.`equip_cod`)) where `n`.`nac_nombre` = 'ARG' order by `j`.`jug_gls` desc limit 10;

